import React,{useState} from "react"

function Login(){
const[text,setText]=useState(
    {login:"",
    password:"",
    phone:"",
    name:"",
    surname:""}
    )

console.log(text)
    return( 
    <div className="input_div">
   

<div class="input-group">
  <span class="input-group-text">First and last name</span>
  <input type="text" aria-label="First name" class="form-control" placeholder="введите ваше имя" value={text.name} onChange={e=>setText(p=>{
        return {...p,name:e.target.value}
    })}  ></input>
  <input type="text" aria-label="Last name" class="form-control" placeholder="введите вашу фамилию" value={text.surname} onChange={e=>setText(p=>{
        return {...p,surname:e.target.value}
    })}  ></input>
</div>






<div><input type="text" className="input_data" placeholder="введите ваш номер телефона" value={text.phone} onChange={e=>setText(p=>{
        return {...p,phone:e.target.value}
    })}></input></div>


<div><input type="text" className="input_data" placeholder="придумайте логин" value={text.login} onChange={e=>setText(p=>{
        return {...p,login:e.target.value}
    })}></input></div>
    




<div><input type="text" className="input_data" placeholder="придумайте пароль" value={text.password} onChange={e=>setText(p=>{
        return {...p,password:e.target.value}
    })}></input></div>

<button type="button" class="btn btn-success">Зарегистрироваться</button>

    </div>
    )
}
export default Login
